import React from "react";
import Card from "../UI/Card";

const UsersList = props => {
    console.log(props.usersList);
    return(
        <Card>
            <ul>
                {props.usersList.map((user) => {
                    <li>{user.name} is {user.age} years old.</li>
                }
                )}
            </ul>
        </Card>
    )
}
export default UsersList;
